-- Данный проект описывает модель хранения данных сайта hh.ru. 
-- Здесь хранятся вакансии, резюме, а также личная и контактная информация пользователей и компаний
-- Данная БД позволяет пользователям находить подходящие им вакансиии, а компаниям - резюме. 
-- Есть возиожность находить вакансии и резюме по определенным регионам и профессиональным областям с желаемым опытом и уровнем зарплаты


DROP DATABASE hh;
CREATE DATABASE hh;
USE hh;


CREATE TABLE users (
  id INT UNSIGNED NOT NULL AUTO_INCREMENT PRIMARY KEY,  
  first_name VARCHAR(100) NOT NULL,
  last_name VARCHAR(100) NOT NULL,
  birthday DATE,
  sex CHAR(1) NOT NULL,
  email VARCHAR(120) NOT NULL UNIQUE,
  phone VARCHAR(120) NOT NULL UNIQUE
);

CREATE TABLE cv (
  id INT UNSIGNED NOT NULL AUTO_INCREMENT PRIMARY KEY,
  user_id INT UNSIGNED NOT NULL,
  prof_id INT UNSIGNED NOT NULL,
  experience INT UNSIGNED NOT NULL,
  salary INT UNSIGNED,
  region_id INT UNSIGNED NOT NULL,
  visibility_id INT UNSIGNED NOT NULL,
  status_id INT UNSIGNED NOT NULL,
  created_at DATETIME DEFAULT NOW(),
  updated_at DATETIME DEFAULT NOW() ON UPDATE NOW()
);

CREATE TABLE prof_fields (
  id INT UNSIGNED NOT NULL AUTO_INCREMENT PRIMARY KEY,  
  name VARCHAR(100) NOT NULL
);

CREATE TABLE regions (
  id INT UNSIGNED NOT NULL AUTO_INCREMENT PRIMARY KEY,  
  name VARCHAR(100) NOT NULL
);

CREATE TABLE vacancies (
  id INT UNSIGNED NOT NULL AUTO_INCREMENT PRIMARY KEY,  
  name VARCHAR(100) NOT NULL,
  company_id VARCHAR(100) NOT NULL,
  email VARCHAR(120) NOT NULL UNIQUE,
  phone VARCHAR(120) NOT NULL UNIQUE,
  prof_id INT UNSIGNED NOT NULL,
  experience INT UNSIGNED NOT NULL,
  salary INT UNSIGNED,
  region_id INT UNSIGNED NOT NULL,
  visibility_id INT UNSIGNED NOT NULL,
  created_at DATETIME DEFAULT NOW(),
  updated_at DATETIME DEFAULT NOW() ON UPDATE NOW()
);

CREATE TABLE companies (
  id INT UNSIGNED NOT NULL AUTO_INCREMENT PRIMARY KEY,  
  name VARCHAR(100) NOT NULL,
  address VARCHAR(100) NOT NULL UNIQUE,
  email VARCHAR(120) NOT NULL UNIQUE,
  phone VARCHAR(120) NOT NULL UNIQUE
);


CREATE TABLE visibility_statuses (
  id INT UNSIGNED NOT NULL AUTO_INCREMENT PRIMARY KEY,
  name VARCHAR(150) NOT NULL UNIQUE
);


CREATE TABLE cv_statuses (
  id INT UNSIGNED NOT NULL AUTO_INCREMENT PRIMARY KEY,
  name VARCHAR(150) NOT NULL UNIQUE
);


CREATE TABLE vacancies_statuses (
  id INT UNSIGNED NOT NULL AUTO_INCREMENT PRIMARY KEY,
  name VARCHAR(150) NOT NULL UNIQUE
);




CREATE TABLE messages (
  cv_id INT UNSIGNED NOT NULL AUTO_INCREMENT PRIMARY KEY,
  vacancy_id INT UNSIGNED NOT NULL,
  message TEXT NOT NULL,
  is_delivered BOOLEAN,
  category_id INT UNSIGNED NOT NULL,
  cv_status INT UNSIGNED NOT NULL,
  vacancy_status INT UNSIGNED NOT NULL,
  created_at DATETIME DEFAULT NOW()
);

CREATE TABLE messages_categories(
  id INT UNSIGNED NOT NULL AUTO_INCREMENT PRIMARY KEY,
  name INT UNSIGNED NOT NULL
);


