SELECT 
	message, 
	(SELECT CONCAT (first_name, ' ', last_name) FROM users WHERE id = user_id) AS user_name, 
	(SELECT name FROM companies WHERE id = company_id) AS company_name,
	IF(is_delivered, 'delivered','not_delivered') AS delivery_status,
	created_at
	FROM messages WHERE category_id = 1 AND vacancy_attached IN (
  	(SELECT id 
  	FROM vacancies 
  	WHERE prof_id = 10
    	AND visibility_id = 2 
    	AND status_id = 1)
  	)
UNION
SELECT
	message, 
	(SELECT CONCAT (first_name, ' ', last_name) FROM users WHERE id = user_id) AS user_name, 
	(SELECT name FROM companies WHERE id = company_id) AS company_name,
	IF(is_delivered, 'delivered', 'not_delivered') AS delivery_status,
	created_at
	FROM messages WHERE category_id = 2 AND cv_attached IN (
  	(SELECT id 
  	FROM cv 
  	WHERE prof_id = 10
    	AND visibility_id = 2 
    	AND status_id IN (
      	SELECT id FROM cv_statuses 
        	WHERE name != 'rejected'
    ))
  	);


