SELECT DISTINCT prof_fields.name AS prof_name,
  AVG(vacancies.salary) OVER w AS average_salary,
  MIN(vacancies.salary) OVER w AS min_salary,
  MAX(vacancies.salary) OVER w AS max_salary,
  COUNT(*) OVER w AS total_vacancies
    FROM (vacancies
      JOIN prof_fields
        ON vacancies.prof_id = prof_fields.id)
        WINDOW w AS (PARTITION BY prof_fields.id)
        ORDER BY max_salary DESC;
       

