CREATE OR REPLACE VIEW vacancies_companies AS
SELECT
  c.name AS company_name,
  p.name AS prof_field,
  v.name AS vacancy_name
FROM
  vacancies AS v
JOIN
  companies AS c
ON
  v.company_id = c.id
JOIN
  prof_fields AS p
ON
  v.prof_id = p.id
 ORDER BY company_name;
 
SELECT*FROM vacancies_companies;

CREATE OR REPLACE VIEW cv_users AS
SELECT
  CONCAT (u.first_name, ' ', u.last_name) AS user_name,
  p.name AS prof_field,
  c.id AS cv_id
FROM
  cv AS c
JOIN
  users AS u
ON
  c.user_id = u.id
JOIN
  prof_fields AS p
ON
  c.prof_id = p.id
 ORDER BY u.id;
 

