DELIMITER //
DROP TRIGGER check_vacancies_insert //
CREATE TRIGGER check_vacancies_insert BEFORE INSERT ON vacancies
FOR EACH ROW
BEGIN
	DECLARE vacancy_name VARCHAR(100);
    DECLARE vacancy_email VARCHAR(100);
    DECLARE vacancy_phone VARCHAR(100);
    SELECT 'new vacancy' INTO vacancy_name;
    IF NEW.name IS NULL THEN
		SET NEW.name = vacancy_name;
	END IF;
    SELECT email FROM companies WHERE id = NEW.company_id INTO vacancy_email;
    IF NEW.email IS NULL THEN
		SET NEW.email = vacancy_email;
	END IF;    
    SELECT phone FROM companies WHERE id = NEW.company_id INTO vacancy_phone;
    IF NEW.phone IS NULL THEN
		SET NEW.phone = vacancy_phone;
	END IF;    
END //

DROP TRIGGER check_cv_insert //
CREATE TRIGGER check_cv_insert BEFORE INSERT ON cv
FOR EACH ROW
BEGIN
    DECLARE cv_email VARCHAR(100);
    DECLARE cv_phone VARCHAR(100);
    SELECT email FROM users WHERE id = NEW.user_id INTO cv_email;
    IF NEW.email IS NULL THEN
		SET NEW.email = cv_email;
	END IF;    
    SELECT phone FROM users WHERE id = NEW.user_id INTO cv_phone;
    IF NEW.phone IS NULL THEN
		SET NEW.phone = cv_phone;
	END IF;    
END //

DROP TRIGGER check_vacancies_update //
CREATE TRIGGER check_vacancies_update BEFORE UPDATE ON vacancies
FOR EACH ROW
BEGIN
    IF NEW.name IS NULL THEN
		SIGNAL SQLSTATE '45000'
		SET MESSAGE_TEXT = 'Name is NULL';
	END IF;
    IF NEW.email IS NULL THEN
		SIGNAL SQLSTATE '45000'
		SET MESSAGE_TEXT = 'Email is NULL';
	END IF;    
    IF NEW.phone IS NULL THEN
		SIGNAL SQLSTATE '45000'
		SET MESSAGE_TEXT = 'Phone is NULL';
	END IF;    
END //

