DROP PROCEDURE IF EXISTS vacancies_offers //
CREATE PROCEDURE vacancies_offers (IN cv_id INT)

  BEGIN 
    (
      SELECT v.id
        FROM vacancies v
          JOIN cv c
            ON c.prof_id = v.prof_id
        WHERE c.id = cv_id
    )
        
    ORDER BY RAND()
    LIMIT 3;
     
END//

DROP PROCEDURE IF EXISTS cv_offers //
CREATE PROCEDURE cv_offers (IN vacancy_id INT)

  BEGIN 
    (
      SELECT c.id
        FROM cv c
          JOIN vacancies v
            ON v.prof_id = c.prof_id
        WHERE v.id = vacancy_id
    )
        
    ORDER BY RAND()
    LIMIT 3;
     
END//

